var real = new Vue({
	el: '#play',
	data: {
		real: plus.webview.getWebviewById('play'),
		token: {},
		pages: {
			share_token: '',
			lists: false,
			more: false,
			ClassList: 'grid',
		},
		video: {
			src: false,
			state: false,
			autoplay: true,
			initime: '0',
			duration: false,
			controls: false,
		},
		play: false,
		icon: {
			poster: 'data:image/gif;base64,',
			video: 'data:image/svg+xml;base64,',
			more: 'data:image/svg+xml;base64,',
			moreOutline: 'data:image/svg+xml;base64,',
			link: 'data:image/svg+xml;base64,',
			share: 'data:image/svg+xml;base64,',
			house: 'data:image/svg+xml;base64,',
			error: 'data:image/svg+xml;base64,',
			download: 'data:image/svg+xml;base64,',
		},
		played: JSON.parse(plus.storage.getItem("played")) || [],
	},
	created() {
		this.real.show()
		console.log('vue创建')
		
		let _index = this.played.findIndex(res => res.db == this.real.db)
		if(_index >= 0){
			let _play = this.played[_index]
			this.played.splice(_index,1)
			this.played.unshift({..._play,db: this.real.db, name: this.real.name, link: this.real.link, part: this.real.part || _play.part, folder: _play.folder || '0'})
		}else{
			this.played.unshift({db: this.real.db, name: this.real.name, link: this.real.link, part: 0, folder: '0'})
		}
		plus.storage.setItem('played',JSON.stringify(this.played))
		this.Show()
	},
	methods: {
		
		async Show(){
			console.log('show')
			this.token = JSON.parse(plus.storage.getItem("token")) || {}
			this.token.avatar = this.token.avatar || this.icon.video
			this.token.nick_name = this.token.nick_name || 'Immers'
			
			if(this.token?.user_id && !this.pages.lists){
				const GetStoken = await this.GetStoken(this.played[0].link)
				this.pages.share_token = GetStoken
				const GetLists = await this.GetLists(this.played[0].link, 'root', this.pages.share_token.share_token)
				this.pages.lists = GetLists
				if(this.pages.lists && this.pages.lists[0].name.length >= 3 || this.pages.lists.length == 1) this.pages.ClassList = 'table lists'
				this.Plays()
			}else if(!this.token?.user_id){
				plus.nativeUI.toast("请登录")
				uni.navigateTo({
					url: 'webview?call=get',
				})
			}
			
			if(this.video.state){
				if(this.play.play) this.play.play()
				this.video.state = false
			}
			
		},
		
		Hide(){
			this.video.state = true
			if(this.play.pause) this.play.pause()
		},
		
		GoInfo(){
			uni.navigateTo({
				url: 'info',
			})
		},
		
		async GetStoken(share_id) {
			const StorageStoken = JSON.parse(plus.storage.getItem(`${share_id}_shareToken`)) || true
			if (StorageStoken || Date.now() > Date.parse(StorageStoken.expire_time)) {
				const Stoken = await this.Stoken(share_id)
				plus.storage.setItem(`${share_id}_shareToken`, JSON.stringify(Stoken))
				return Stoken
			}
		
			return StorageStoken
		},
		
		async Stoken(share_id, share_pwd = '') {
			const Stoken = await axios({
				method: 'post',
				url: '//api.aliyundrive.com/v2/share_link/get_share_token',
				data: {
					share_id,
					share_pwd
				},
			}).then(res => {
				return res.data
			}).catch(res => {
				this.played.splice(0,1)
				plus.nativeUI.toast("资源错误")
				plus.storage.setItemAsync('played',JSON.stringify(this.played),() => {
					uni.navigateBack()
				})
			})
			
		
			return Stoken
		
		},
		
		async GetLists(link, id, stoken) {
			const Lists = await this.Lists(link, id, stoken)
			if (Lists && Lists[0].type == 'folder') {
				const Folds = await this.Lists(link, Lists[0].file_id, stoken)
				if (Folds[0].type == 'folder') {
					this.pages.folds = Folds
					const Clarity = await this.Lists(link, Folds[this.played[0].folder].file_id, stoken)
					return Clarity
				}
				return Folds
			}
			
			return Lists
		},
		
		async Lists(link, id, token) {
			const Lists = await axios({
				method: 'post',
				url: '//api.aliyundrive.com/adrive/v3/file/list',
				data: {
					'share_id': link,
					'parent_file_id': id,
					'order_by': 'name',
					'order_direction': 'ASC'
				},
				headers: {
					'x-share-token': token,
				},
			}).then(res => {
				if(!res.data.items || !res.data.items.length){
					return false
				}
				res.data.items.forEach((el, index) => {
					
					if (el.mime_extension == 'txt') {
						res.data.items.splice(index, 1)
					} else {
						res.data.items[index].name = el.name.split('.')[0]
					}
					
				})
				
				return res.data.items
		
			}).catch(err => {
				return false
			})
			
			if(!Lists){
				this.played.splice(0,1)
				plus.nativeUI.toast("资源错误")
				plus.storage.setItemAsync('played',JSON.stringify(this.played),() => {
					uni.navigateBack()
				})
			}
			
			return Lists
		
		},
		
		async Plays(){
			// this.video.state = false
			// this.video.controls = false
			// this.video.poster = this.pages.lists[this.played[0].part].thumbnail
			if(Date.now() > Date.parse(this.token.expire_time)){
				const UpToken = await this.UpToken()
				this.token = UpToken
				plus.storage.setItem('token',JSON.stringify(UpToken))
			}
			if(this.pages.lists[this.played[0].part].name.search(/[0-99999]/) >= 0){
				document.title = `${this.played[0].name} 第${this.pages.lists[this.played[0].part].name}集 - 沐享影视`
			}else{
				document.title = `${this.played[0].name} - 沐享影视`
			}
			
			const Copy = await this.Copy(this.played[0].link, this.pages.lists[this.played[0].part].file_id, this.pages.share_token.share_token)
			const PreviewPlay = await this.PreviewPlay(this.token.access_token,Copy.responses[0].body.file_id)
			
			
			let sourse = {}
			PreviewPlay.forEach(res => sourse[res.template_id] = res.url)
			
			this.play = new Aliplayer({
				id: 'video',
				source: JSON.stringify(sourse),
				autoplay: true,
				showBarTime: 3300,
				controlBarVisibility: 'click',
				enableSystemMenu: true
			})
			
			
			this.play.on('ready',() => {
				if(this.played[0][this.played[0].part]) this.play.seek(this.played[0][this.played[0].part])
			})
			
			this.play.on('timeupdate',() => {
				this.UpTime()
			})
			
			this.play.on('ended',() => {
				this.Push(this.played[0].part,1)
			})
			
			// this.play.on('error',() => {
			// 	this.play.dispose()
			// 	this.Plays()
			// })
			
			
			if(plus.os.name != 'iOS'){
				this.play.on('requestFullScreen',() => {
					plus.screen.lockOrientation('landscape')
				})
				
				this.play.on('cancelFullScreen',() => {
					plus.screen.lockOrientation('portrait-primary')
				})
			}
			
			this.Delete(Copy.responses[0].body.file_id,this.token.access_token)

		},
		
		async UpToken(){
			const UpToken = await axios({
				url: '//api.aliyundrive.com/token/refresh',
				method: 'POST',
				data:{
					refresh_token: this.token.refresh_token
				}
			}).then(res => {
				return res.data
			})
			
			return UpToken
			
		},
		
		Delete(ID,Token){
			axios({
				// api.aliyundrive.com/v2/recyclebin/trash
				url: "//api.aliyundrive.com/v3/file/delete",
				method: "post",
				data: {
					"drive_id": this.token.default_drive_id,
					"file_id": ID,
				},
				headers: {
					'authorization': `Bearer ${Token}`,
					'content-type': 'application/json;charset=utf-8',
				},
			})
		},
		
		async Copy(Link, ID, Stoken, Token){
			const Copy = await axios({
				url: "//api.aliyundrive.com/adrive/v2/batch",
				method: "post",
				headers: {
					'authorization': `Bearer ${this.token.access_token}`,
					'content-type': 'application/json;charset=utf-8',
					'x-share-token': Stoken
				},
				data: {"requests":[{"body":{"file_id": ID,"share_id": Link,"auto_rename":true,"to_parent_file_id":"root","to_drive_id": this.token.default_drive_id},"headers":{"Content-Type":"application/json"},"id":"0","method":"POST","url":"/file/copy"}],"resource":"file"}
			}).then(res => {
				return res.data
			})
			
			return Copy
		},
		
		async PreviewPlay(Token, Id){
			const PreviewPlay = await axios({
				url: "//api.aliyundrive.com/v2/file/get_video_preview_play_info",
				method: "post",
				data: {
					"drive_id": this.token.default_drive_id,
					"file_id": Id,
					"category": "live_transcoding",
					"template_id": "",
					"get_subtitle_info": true,
				},
				headers: {
					'authorization': `Bearer ${Token}`,
					'content-type': 'application/json;charset=utf-8',
				}
			}).then(res => res.data)
			
			return PreviewPlay.video_preview_play_info.live_transcoding_task_list
			
		},
		
		async Play(ID, Token) {
		
			const Play = await axios({
				method: 'post',
				url: '//api.aliyundrive.com/v2/file/get_share_link_download_url',
				data: {
					'share_id': this.played[0].link,
					'file_id': ID,
				},
				headers: {
					'authorization': `Bearer ${Token}`,
					'content-type': 'application/json;charset=utf-8',
					'x-share-token': this.pages.share_token.share_token
				}
			}).then(res => {
				
				return res.data
			})
			
			this.video.poster = this.pages.lists[this.played[0].part].thumbnail
			this.video.src = Play.download_url
			this.video.state = true
			this.video.controls = true
			console.log(Play.download_url)
		},
		
		Push(parts,Plus = 0){
			if(parts == this.pages.lists.length - 1) return false
			this.played[0].part = parts + Plus
			plus.storage.setItem('played',JSON.stringify(this.played))
			this.play.dispose()
			this.Plays()
		},
		
		UpTime(){
			this.played[0][this.played[0].part] = this.play.getCurrentTime()
			plus.storage.setItemAsync('played',JSON.stringify(this.played))
		},
		
		SetInitial(){
			this.$refs.video.currentTime = this.played[0][this.played[0].part] || 0
		},
		
		async Folds(e){
			plus.storage.setItem('played',JSON.stringify(this.played))
			this.pages.lists = false
			const Lists = await this.Lists(this.played[0].link, this.pages.folds[this.played[0].folder].file_id, this.pages.share_token.share_token)
			this.pages.lists = Lists
			this.Plays()
		},
		
		Home(){
			uni.navigateBack({
				delta: 88,
				url: 'home'
			})
		},
		
		Share(){
			plus.share.sendWithSystem({type:'text',content: `${this.played[0].name} - 沐享影视` , href: `https://v.immers.icu/${Number(this.played[0].db).toString(32)}/${this.played[0].link}/${this.played[0].part}`})
		},
		
		ShareCopy(){
			plus.storage.setItem('copy',this.played[0].link)
			let copy = `${this.token.nick_name}:/ ${this.played[0].name} https://v.immers.icu/${Number(this.played[0].db).toString(32)}/${this.played[0].link}/${this.played[0].part} 复制此链接，打开沐享影视APP，直接观看视频！`
			let textarea = document.createElement("textarea")
			textarea.value = copy
			document.body.appendChild(textarea)
			textarea.select()
			document.execCommand("copy") 
			textarea.remove()
			plus.nativeUI.toast("已复制")
		},
		
	}
})